import React, { Component } from "react";
import "./style.css";

import image from "../../../../img/first-sec-img.svg";

export default class SecondSection extends Component {
  render() {
    return (
      <section id="second-sec">
        <div className="container">
          <div className="row">
            {/* Lado ESQUERDO*/}
            <div className="col-md-6 col-sm-12 generalTexts">
              <h1 className="promo-title">Quem somos?</h1>
              <p className="promo-subtitle ">
                Tenha um site com as tecnologias mais quentes no mercado! Sites
                rápidos, responsivos, e com design perfeito para você.
              </p>
            </div>

            {/* Lado DIREITO */}
            <div className="col-md-6" />
          </div>
        </div>
      </section>
    );
  }
}
